import { Page } from "./Page";
import { Link } from "react-router-dom";

export const MacibuMateriali = () => {
  const handleClick = () => {
    window.scrollTo(0, 0);
  };

  return (
    <Page>
      <div className="min-h-screen">
        {/* About us, bg image */}
        <div className="relative flex bg-center justify-center items-center bg-[url('assets/images/latvijasBiblioteka/resursi.jpg')] md:h-about h-screen bg-cover bg-no-repeat">
          <div className="absolute top-1/2 transform -translate-y-1/2">
            <h1 className="text-4xl md:text-5xl lg:text-6xl text-white font-bold text-center font-montserrat">
              Mācību materiāli
            </h1>
          </div>
        </div>
        <div className="px-4 md:px-12 lg:px-20">
          {/* Rest of the content */}
        </div>
        <div className="text-center text-3xl mb-12">
          <Link to="/celsUzLu" onClick={handleClick}>
            <button className="text-white px-4 py-2 rounded bg-unFocused hover:bg-focused transition font-semibold text-base sm:text-lg">
              Kā es nokļūstu līdz LU DF?
            </button>
          </Link>
        </div>
      </div>
    </Page>
  );
};
